export const fetchApi = (query) => {
    console.log(query)
    fetch(`https://svc.metrotransit.org/nextripv2/`+query).then(response => response.json())
    .catch(error => {
        console.error(error);
    })
}

export const fetchApi1 = (query) => {
    const queryUrl = 'https://svc.metrotransit.org/nextripv2/'+query
    return fetch(queryUrl).then(response => response.json())
    // .then(data => {
